  false,\n\t\"url\": null,\n\t\"notes\": \"A 2D numerical model, CMS-Flow, was implemented
  for the Northeast Corridor Reserve (NECR) using a telescoping grid. Tide and wind
  forcing was provided to the model and the model was validated using water level
  data from the Fajardo NOAA NOS tide gauge and with current data from the CariCOOS
  Buoy in Vieques sound. The model was run from November 1-30, 2013 in order to determine
  the spatial distribution of the maximum current speed field within the NECR. All
  dates and times are UTC. Current speeds are in meters per second.\",\n\t\"owner_org\":
